import { SVGProps } from "react";

export function Audi(props: SVGProps<SVGSVGElement>) {
	return (
		<svg
			{...props}
			width="100"
			height="100"
			viewBox="0 0 100 100"
			fill="none"
			xmlns="http://www.w3.org/2000/svg"
			xmlnsXlink="http://www.w3.org/1999/xlink"
		>
			<rect width="100" height="100" fill="url(#pattern0_5_76)" />
			<defs>
				<pattern id="pattern0_5_76" patternContentUnits="objectBoundingBox" width="1" height="1">
					<use xlinkHref="#image0_5_76" transform="scale(0.01)" />
				</pattern>
				<image
					id="image0_5_76"
					width="100"
					height="100"
					preserveAspectRatio="none"
					xlinkHref="data:image/jpeg;base64,"
				/>
			</defs>
		</svg>
	);
}

